pragma solidity ^0.4.17;

import './ContractProviderEnabled.sol';
import './Limited.sol';

import './interfaces/IAssetRegistry.sol';
import './interfaces/IEntityRegistry.sol';
import './interfaces/IContractProvider.sol';
import 'zeppelin-solidity/contracts/math/SafeMath.sol';

contract AssetRegistry is ContractProviderEnabled, Limited, IAssetRegistry {
    using SafeMath for uint256;

    struct Asset {
        string name;
        uint256 totalShareNumber;
        mapping(bytes32 => uint256) shareholders;
        bytes32[] shareholdersLUT;
        bytes32[30] requiredApprovals;
        uint256 index;
    }

    struct Confirmation {
        uint8 count;
        mapping(bytes32 => bool) approvals;
    }

    mapping(bytes32 => Confirmation) public confirmations;

    mapping(bytes32 => Asset) public assets;
    bytes32[] public assetsLUT;

    event LogPendingConfirmation(
        bytes32 indexed assetId,
        bytes32 indexed entityId,
        uint256 numberOfShares,
        uint8 count,
        bytes32 key,
        address sender
    );

    event LogNewAsset(
        bytes32 indexed assetId,
        string name,
        uint256 indexed totalShareNumber,
        uint256 index
    );

    event LogAssetUpdated(
        bytes32 indexed assetId,
        string name,
        uint256 indexed totalShareNumber,
        uint256 index
    );

    event LogNewShareholder(
        bytes32 indexed assetId,
        bytes32 indexed entityId,
        uint256 indexed numberOfShares
    );

    event LogShareholderUpdated(
        bytes32 indexed assetId,
        bytes32 indexed entityId,
        uint256 indexed numberOfShares
    );

    /**
     * Check if asset exists
     */
    modifier assetExists(bytes32 assetId) {
        require(doesAssetExist(assetId));
        _;
    }

    modifier onlySettlement() {
        address settlement = IContractProvider(cp).contracts("settlement");
        require(msg.sender == settlement);
        _;
    }

    modifier onlyApproved(bytes32 assetId, bytes32 entityId, uint256 numberOfShares) {
        bytes32 key = hashData(msg.data);
        bytes32 approvingEntityId = onlyRequiredApproval(assetId, key);

        // if you already confirmed that transaction, do nothing
        if (confirmations[key].approvals[approvingEntityId]) return;

        confirmations[key].approvals[approvingEntityId] = true;
        confirmations[key].count++;

        // is it not confirmed?
        if (getApprovalsCount(assetId) > confirmations[key].count) {
            LogPendingConfirmation(
                assetId,
                entityId,
                numberOfShares,
                confirmations[key].count,
                key,
                msg.sender
            );
            return;
        }
        delete confirmations[key];
        _;
    }

    function doesAssetExist(bytes32 assetId)
        public
        view
        returns(bool)
    {
        bytes memory name = bytes(assets[assetId].name);
        return name.length != 0 && assets[assetId].totalShareNumber != 0;
    }

    function validateSeller(bytes32 assetId, bytes32 sellerId, uint256 numberOfShares)
        external
        view
        assetExists(assetId)
        returns (bool)
    {
        require(assetId != "");
        require(sellerId != "");
        require(numberOfShares != 0);

        if (assets[assetId].shareholders[sellerId] >= numberOfShares) {
            return true;
        } else {
            return false;
        }
    }

    function hashData(bytes data)
        public
        pure
        returns (bytes32 hashed)
    {
        return keccak256(data);
    }

    /**
     * Add new asset
     * Note: approvals should have the property that all addresses at indices
     * greater than the index of a zero address are also zero.
     */
    function addAsset(bytes32 assetId, string name, uint256 totalShareNumber, bytes32[30] approvals)
        public
        performs(NetworkActivity.AddAsset)
        returns (bool)
    {
        bytes memory assetName = bytes(assets[assetId].name);
        require(assetName.length == 0);
        require(assets[assetId].totalShareNumber == 0);
        require(assets[assetId].index == 0);

        require(assetId != "");
        bytes memory bytesName = bytes(name);
        require(bytesName.length != 0);
        require(totalShareNumber != 0);

        bytes32[] memory emptyArray;
        assets[assetId] = Asset({
            name: name,
            totalShareNumber: totalShareNumber,
            shareholdersLUT: emptyArray,
            requiredApprovals: approvals,
            index: assetsLUT.length
            });
        assetsLUT.push(assetId);

        LogNewAsset(assetId, name, totalShareNumber, assetsLUT.length - 1);
        return true;
    }

    /**
    * Update existing asset
    * Note: approvals should have the property that all addresses at indices
    * greater than the index of a zero address are also zero.
    */
    function updateAsset(bytes32 assetId, string name, uint256 totalShareNumber, bytes32[30] approvals)
        public
        performs(NetworkActivity.UpdateAsset)
        assetExists(assetId)
        returns (bool)
    {
        Asset storage asset = assets[assetId];
        asset.name = name;
        asset.totalShareNumber = totalShareNumber;
        asset.requiredApprovals = approvals;

        LogAssetUpdated(assetId, asset.name, asset.totalShareNumber, asset.index);
        return true;
    }


    function getTotalShareNumber(bytes32 assetId) public view returns (uint256) {
        return assets[assetId].totalShareNumber;
    }

    function getName(bytes32 assetId) public view returns (bytes) {
        return bytes(assets[assetId].name);
    }

    function getAssetsCount() public view returns (uint256) {
        return assetsLUT.length;
    }

    function getShareholdersCount(bytes32 assetId) public view returns (uint256) {
        return assets[assetId].shareholdersLUT.length;
    }

    function getShareholderShares(bytes32 assetId, bytes32 shareholderId)
        public
        view
        returns (uint256)
    {
        return assets[assetId].shareholders[shareholderId];
    }

    /**
     * Add shareholder to already existing asset
     */
    function addShareholder(bytes32 assetId, bytes32 entityId, uint256 numberOfShares)
        public
        performs(NetworkActivity.ManageShareholder)
        assetExists(assetId)
        onlyApproved(assetId, entityId, numberOfShares)
        returns (bool)
    {
        require(assetId != "");
        require(entityId != "");
        require(numberOfShares != 0);

        Asset storage asset = assets[assetId];
        asset.shareholders[entityId] = numberOfShares;
        asset.shareholdersLUT.push(entityId);

        LogNewShareholder(assetId, entityId, numberOfShares);
        return true;
    }

    /**
     * Update existing shareholder
     */
    function updateShareholder(bytes32 assetId, bytes32 entityId, uint256 numberOfShares)
        public
        performs(NetworkActivity.ManageShareholder)
        assetExists(assetId)
        onlyApproved(assetId, entityId, numberOfShares)
        returns(bool)
    {
        require(assetId != "");
        require(entityId != "");

        assets[assetId].shareholders[entityId] = numberOfShares;

        LogShareholderUpdated(assetId, entityId, numberOfShares);
        return true;
    }

    function increaseHoldings(bytes32 assetId, bytes32 entityId, uint256 numberOfShares)
        public
        assetExists(assetId)
        onlySettlement
        returns(bool)
    {
        require(assetId != "");
        require(entityId != "");

        assets[assetId].shareholders[entityId] =
            assets[assetId].shareholders[entityId].add(numberOfShares);

        LogShareholderUpdated(assetId, entityId, assets[assetId].shareholders[entityId]);
        return true;
    }

    function decreaseHoldings(bytes32 assetId, bytes32 entityId, uint256 numberOfShares)
        public
        assetExists(assetId)
        onlySettlement
        returns(bool)
    {
        require(assetId != "");
        require(entityId != "");

        assets[assetId].shareholders[entityId] =
            assets[assetId].shareholders[entityId].sub(numberOfShares);

        LogShareholderUpdated(assetId, entityId, assets[assetId].shareholders[entityId]);
        return true;
    }

    /**
     * Fetch the list of required approvals
     */
    function getRequiredApproval(bytes32 assetId, uint256 i)
        public
        view
        returns (bytes32)
    {
        require(assetId != "");
        return assets[assetId].requiredApprovals[i];
    }

    /**
     * Get the number of required approvals
     */
    function getApprovalsCount(bytes32 assetId)
        public
        view
        returns (uint256)
    {
        bytes32[30] storage approvals = assets[assetId].requiredApprovals;
        for (uint8 i = 0; i < approvals.length; i++) {
            if (approvals[i] == bytes32(0))
                return i;
        }
        return approvals.length;
    }

    function onlyRequiredApproval(bytes32 assetId, bytes32 key)
        internal
        view
        returns (bytes32 entityId)
    {
        address entityRegistryAddr = IContractProvider(cp).contracts("entity_registry");

        bytes32[30] storage approvals = assets[assetId].requiredApprovals;
        for (uint8 i = 0; i < approvals.length; i++) {
            address entityOwner = IEntityRegistry(entityRegistryAddr).getOwner(approvals[i]);
            if (
                !confirmations[key].approvals[approvals[i]]
                && (entityOwner == msg.sender
                || IEntityRegistry(entityRegistryAddr).delegates(approvals[i], msg.sender))
                ) {
                return approvals[i];
            }
        }
        revert();
    }

}
